import ChatBot from 'react-simple-chatbot';
import React, { Component }  from 'react';

const ChatSteps = [
    {
        id: '0',
        message: 'Hello Welcome',
        trigger: '1',
    },{
        id: '1',
        message: 'Please enter legal name:',
        trigger: '2'
      },{

        id: '2',
        user: true,
        trigger: '3',
      },
      {
        id: '3',
        name: "previousValue",
        message: "hi {previousValue}, how may I help you?",
        trigger: '4',
      },{

        id: '4',
        message: "{name} what's up",
        end: true
      }

];
 
function App() {
    return (
        <div className="App">
            <h1>Welcome to HealthBot</h1>
            <ChatBot steps={ChatSteps} />
        </div>
    );
}
 
export default App;
